import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import ItemForm from "./ItemForm";
import './resources/Form.css'

const Cough = ({ setForm, formData, navigation }) => {
  const { no, ibland, ofta, allTime} = formData;

  const { previous, next } = navigation;

  return (
    <div className="form">
      <h3>Har du nyligen börjat hosta?</h3>
      <ItemForm label="no" name="no" value={no} onChange={setForm} />
      <ItemForm label="Ja. Hostar ibland" name="ibland" value={ibland} onChange={setForm} />
      <ItemForm label="Ja. Hostar ofta" name="ofta" value={ofta} onChange={setForm} />
      <ItemForm label="Ja. Hostar nästan hela tiden" name="allTime" value={allTime} onChange={setForm} />
      <div>
        <Button onClick={previous}>Previous</Button>{' '}
        <Button onClick={next}>Next</Button>
      </div>
    </div>
  );
};

export default Cough;
